import React, {Component} from 'react'

class FilterBar extends Component {

    constructor() {
        super()
        this.state = {
            filtered: false
        }
    }

    render() {
        return(
            <div id='filter-div'>
                <button onClick={() => this.props.filter()} id='good-dog-filter'>Filter good dogs: {this.state.filtered === true ? "ON" : "OFF"}</button>
            </div>
        )
    }

}

export default FilterBar
